import React from 'react'
import Grid from '@material-ui/core/Grid';
import Padding from '../components/padding'
import { connect } from 'react-redux';

class AddressComponent extends React.Component{
    render(){
        const {street, city, state, zip} = this.props.formReducer.step1.address;
        return(
            <Grid container justify="center" direction="column" alignItems="center" spacing={5}>
                <Grid item xs={12}>
                    <h1 style={{color: '#084177'}}>Address Information</h1>
                </Grid>
                <Padding length="1" name="padding-1"/>

            </Grid>
        )
    }
}

function mapStateToProps(state){
    return state;
}

export default connect(mapStateToProps)(AddressComponent);
